These moms got the moves!
Phoenix and her husband invite their son's coach over, so he gives them a pep talk about family values. Veronica and her man are house shopping, but she's more into the real estate agent than the architecture. Kristal's husband is more interested in watching wrestling then making love to his wife, so her big black friend comes over and puts her in a hold her man won't forget. India and her husband bring over a personal trainer, and he plans to give India the workout of a lifetime.

